`


export const Wrapper = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    width: 100%;
    margin: 10px;
    padding-bottom: 10px;
    border-bottom: 1px dashed rgba(0,0,0,0.5)
`
